import './form.css';

function Form() {
    return(
        <select id='selectionMenu' class="form-select" aria-label="Default select example">
            <option selected>Select Vaccination Status</option>
            <option value="1">I am fully vaccinated.</option>
            <option value="2">I am partially vaccinated.</option>
            <option value="3">I am not vaccinated.</option>
        </select>
    )
}

export default Form;
